import swDev from '../swDev'
const storedData = JSON.parse(localStorage.getItem("MyUser"));
const Pushnotification = () => {
    if(storedData && storedData.gh === 0){
        alert("test")
        swDev();
    }
    return (
        <div style={{marginTop:'150px'}}>
            Hello World!
        </div>
    )
}

export default Pushnotification;
